function ifScript() {
	var obsIds = workflow.inputs.observable_ids;
	var domainId = workflow.inputs.domain_id;
	var implId = workflow.inputs.implementation_id;
	
	var util = new x_952688_dnsdb.DomainToolsDNSDBLookup(implId, domainId);
	// filter observables
	obsIds = util.filterUnsupportedObservablesByType(obsIds);
	obsIds = obsIds.join(','); // make string again to fit into workflow input type
		
	if (!gs.nil(obsIds)) {
		workflow.inputs.observables_ids = obsIds;
		return 'yes';
	}
	return 'no';
}

