function ifScript() {
	var success = false;
	
	var implId = workflow.inputs.implementation_id;
	var domainId = workflow.inputs.domain_id;
	var observableIds = workflow.inputs.observable_ids;
	var trackingId = data.get(7).capabilityExecutionId;
	var taskSysId = workflow.inputs.task_sys_id;
	var limit = workflow.inputs.u_limit;
	var look_back = workflow.inputs.u_look_back;
	var record_type = workflow.inputs.u_record_type;

	var util = new x_952688_dnsdb.DomainToolsDNSDBLookup(implId, domainId);
	if(util.isValidClass()) {
		gs.info("inside valid class");
		var resultObj = util.performLookup(trackingId, observableIds, domainId, taskSysId, record_type, limit, look_back, context.sys_id, context.name);
		gs.info("after result object");
		workflow.scratchpad.response_data = resultObj.response_data;
		workflow.scratchpad.mapping_id = resultObj.mapping_id;
		
		if (!gs.nil(resultObj.success) && resultObj.success + '' == 'true')
			success = true;
	}
	return success;
}

