var obsIds = workflow.inputs.observable_ids + '';
var obsMap = {};

if (!gs.nil(obsIds)) {
    obsIds = (obsIds + '').split(',');
    for (var i = 0; i < obsIds.length; i++) {
                var obsId = obsIds[i];
                obsMap[obsId] = true;
    }

for (var key in obsMap) {
        var workflowId = 'c39a595693440210524174418bba10f3'; // DomainTools Farsight DNSDB
        var workflowGR = new GlideRecord('wf_workflow');
        workflowGR.get(workflowId)
        var workflowName = workflowGR.name + '';

        var workflowInputs = {};
        workflowInputs.implementation_id = workflow.inputs.implementation_id;
        workflowInputs.parent_execution_id = workflow.inputs.parent_execution_id;
        workflowInputs.observable_ids = key;
        workflowInputs.task_sys_id = workflow.inputs.task_sys_id;
        workflowInputs.domain_id = workflow.inputs.domain_id;
        workflowInputs.limit = workflow.inputs.limit;
        workflowInputs.look_back = workflow.inputs.look_back;
        coordinator.add(workflowInputs, workflowName);
  } 
}

// Set the poolsize.
coordinator.setPoolsize(maximumConcurrentRequests);
